import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="player-view-div">
    <div class='status'></div>
    <button class="play-button">play</button>
    <button class="pause-button">pause</button>
    <button class="skip-button">skip</button>
  </div>
  );
}

export default App;
